@RussellBrand and I spoke on his podcast earlier this year. We talked about unity, responsibility, compassion, teaching and how new media has changed free speech.⁣
⁣
You can watch the first hour of our conversation on Russell's YouTube channel.

@AdamCarolla "My feeling is, as someone who grew up with a mother who was this way, and a grandmother who dabbled in communism a little bit, they want to push back against everything that is. It’s more of an anarchist approach than it is, “Here’s my plan.”⁣
⁣
